import React from 'react';
import { render } from 'react-dom';
import OrganismConfigPanel from './OrganismConfigPanel';

type OrganismProps = {
    organismName: string,
    isSelected: boolean,
}
export default class Organism extends React.Component<any, OrganismProps> {
    constructor(props:OrganismProps) {
        super(props);
        if (props) {
            this.state = {
                organismName: '',
                isSelected: false,
            };
        } else {
            this.state = {
                organismName: '',
                isSelected: false,
            };
        }
    }

    render (){
        console.log('@ @ @ organism render called: ', this.props.organismName);
        return (
        <div className='organism'>
            {this.props.organismName}<button className='remove' onClick={removeOrganism}>-</button>
        </div>
        )
    }
}

function removeOrganism() {
    console.log('! ! ! remove organism called');
}

export const FuncOrganism = ( organismName: string , index: number) => (
    <div className='organism' key={index}>
    <p>here's an organism</p>
    {organismName}<button className='remove' onClick={removeOrganism}>-</button>
</div>
)
